void cmp_data(void* data1, void* data2, uint16_t dim[4]){
    float (*d1)[dim[1]][dim[2]][dim[3]] = data1;
    float (*d2)[dim[1]][dim[2]][dim[3]] = data2;
    uint32_t cnt = 0;

    for(uint16_t dim0 = 0; dim0 < dim[0];dim0++)
        for(uint16_t dim1 = 0; dim1 < dim[1];dim1++)
            for(uint16_t dim2 = 0; dim2 < dim[2];dim2++)
                for(uint16_t dim3 = 0; dim3 < dim[3];dim3++){
                    if(d1[dim0][dim1][dim2][dim3] != d2[dim0][dim1][dim2][dim3]){
                        printf("d1[%d][%d][%d][%d]:%2.8f d2[%d][%d][%d][%d]:%2.8f \n",dim0,dim1,dim2,dim3,d1[dim0][dim1][dim2][dim3], \
                            dim0,dim1,dim2,dim3,d2[dim0][dim1][dim2][dim3]);
                            cnt++;
                    }
            }
    printf("num:%d \n",cnt);

}

